import React from 'react';
import avatarka from '../image/down2.jpg';
import p from './Post.module.css';

const Post = (props) => {
  let mymsg = [{ img: avatarka, ike: 'like' }];

  return (
    <div className={p.post}>
      <div className={p.item}>
        <img src={avatarka} />
        {props.msg}
        <div>
          <span>
            <b>like</b>
          </span>
        </div>
      </div>
    </div>
  );
};

export default Post;
